$(document).ready(function () {
	setTimeout(function () {
		AOS.init({
			offset: 60,
			once: false,
			disable: 'phone',
			duration: 300,
			initClassName: 'aos-init',
			animatedClassName: 'aos-animate',
			useClassNames: false,
			disableMutationObserver: false,
			debounceDelay: 50,
			throttleDelay: 99,
		});
	}, 500);

	function sliderInit() {
		let slider = $('.image-text-slides').flickity({
			prevNextButtons: true,
			pageDots: true,
		});
		setTimeout(function () {
			slider.flickity('resize');
		}, 500);
	}
	sliderInit();
	document.addEventListener('shopify:section:load', sliderInit);

	$(document).on('click', '.tabs-liks ul li', function (e) {
		e.preventDefault();
		let tab_id = $(this).data('id');
		$('.tabs-links a,.tabs-content-wrapper > div').removeClass('active');
		$(this).addClass('active');
		$(tab_id).addClass('active');
	});

	// init featured slider
	function featuredSliderInit() {
		var featuredSlider = $('[js-featured-slider-wrapper]');
		var configDesktop = {
			prevNextButtons: false,
			pageDots: false,
			autoPlay: false,
			wrapAround: true,
			draggable: false,
		};
		var configMobile = {
			prevNextButtons: false,
			pageDots: true,
			autoPlay: 2000,
			wrapAround: true,
			draggable: true,
			fade: true,
		};

		$(featuredSlider).each(function (i, el) {
			var slider = $(el).find('[js-featured-slider-main]');
			var prev = $(el).find('[js-featured-slider-prev]');
			var next = $(el).find('[js-featured-slider-next]');

			if ($(window).width() > 767) {
				config = configDesktop;
			} else {
				config = configMobile;
			}

			if ($(slider).flickity() !== 'undefined') {
				$(slider).flickity('destroy');
			}
			$(slider).flickity(config);

			$(prev)
				.off('click')
				.on('click', function () {
					slider.flickity('previous');
				});

			$(next)
				.off('click')
				.on('click', function () {
					slider.flickity('next');
				});

			$(slider)
				.off('change.flickity')
				.on('change.flickity', function (event, index) {
					if (index == 1) {
						$(slider)
							.find('.slider__item')
							.first()
							.addClass('slider__item--right');
					} else {
						$(slider)
							.find('.slider__item')
							.first()
							.removeClass('slider__item--right');
					}
				});
		});
	}
	featuredSliderInit();
	$(window).on('resize', featuredSliderInit);
	document.addEventListener('shopify:section:load', featuredSliderInit);
});